      <div className="site-page-header-ghost-wrapper">
        <PageHeader
          ghost={false}
          title="Title"
          subTitle="This is a subtitle"
          extra={[
            <Button key="3">Operation</Button>,
            <Button key="2">Operation</Button>,
            <Button key="1" type="primary">
              Primary
            </Button>,
          ]}
        ></PageHeader>
      </div>
    </>
  );
};

export default App;
